webpackJsonp([90144357570976],{6883:function(e,t){e.exports={data:{post:{html:'<p><em>Null Bock</em> is the German phrase that describes my mood today. It literally means "no goat", but in this case means I\'m feeling bored and apathetic.</p>\n<p>While on the subject of silly German phrases, it betrays my age pretty exactly to admit the first hip German word I learned was <em>Affentittengeil</em> (literally "monkey tits horny"), something  I haven\'t heard since the early \'80s. (Does that qualify me to march in the <a href="http://www.schlagermove.de/index.php?page=home&city=hamburg">Schlager Move</a> in Hamburg next weekend?)</p>',fields:{title:"I Have No Goat",date:"27 Jun 2004",url:"https://papascott.de/2004-06-27-i-have-no-goat/"}}},pathContext:{slug:"/2004-06-27-i-have-no-goat/",prev:{fields:{title:"Top Hat",date:"26 Jun 2004",slug:"/2004-06-26-top-hat/"}},next:{fields:{title:"Pulling out of here to win",date:"29 Jun 2004",slug:"/2004-06-29-pulling-out-of-here-to-win/"}}}}}});
